import logo from './logo.svg';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './App.css';

// —Å—Ç—Ä–∞–Ω–∏—Ü—ã
function Home() {
  return (
    <div>
      <h1>Quality Assurance Expertise</h1>
      <p>Svetlana Fishchuk</p>
    </div>
  );
}

function About() {
  return <h2>About Me</h2>;
}

function Portfolio() {
  return <h2>Portfolio</h2>;
}

function Articles() {
  return <h2>Articles</h2>;
}

function NewYear() {
  return <h2>Happy New Year üéÑ</h2>;
}

function App() {
  return (
    <Router>
      <div className="App">
      <header className="App-header">
        <h1>Hello! Nice to meet you! </h1>
        <p>Welcome to my page! Here you can find information about me and (I hope) some useful tips about QA</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
        {/* –ù–∞–≤–∏–≥–∞—Ü–∏—è */}
        <nav>
          <Link to="/">Home</Link>
          <Link to="/about">About Me</Link>
          <Link to="/portfolio">Portfolio</Link>
          <Link to="/articles">Articles</Link>
          <Link to="/newyear">Happy New Year</Link>
        </nav>

        {/* –ö–æ–Ω—Ç–µ–Ω—Ç */}
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/portfolio" element={<Portfolio />} />
            <Route path="/articles" element={<Articles />} />
            <Route path="/newyear" element={<NewYear />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
